import React, {useState, useEffect} from "react";
import s from "./Peak.module.css";


const Peak = ({ peak, photo }) => {

    return (
        <div className={s.peak}>
            <div className="imgContainer">
                <img src={photo} alt={peak.name} />
            </div>
            <h2 className={s.name}>{peak.name}</h2>
        </div>
    )
}

export default Peak;
